-- ----------------------------
-- Table structure for fy_activity
-- ----------------------------
DROP TABLE IF EXISTS `fy_activity`;
CREATE TABLE `fy_activity`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '活动表',
  `main_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '活动主图',
  `desc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述',
  `name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '活动名称',
  `start_date` int(11) NULL DEFAULT NULL COMMENT '活动开始时间 ',
  `end_date` int(11) NULL DEFAULT NULL COMMENT '活动结束时间',
  `url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '活动链接',
  `detail` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '活动详情描述',
  `lottery_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '奖券名称',
  `lottery_id` int(11) NULL DEFAULT NULL COMMENT '关联奖券id',
  `update_time` int(11) NULL DEFAULT NULL,
  `create_time` int(11) NULL DEFAULT NULL,
  `status` tinyint(4) NULL DEFAULT 1 COMMENT '0否1是',
  `isdelete` tinyint(1) NULL DEFAULT 0 COMMENT '0否1是',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

