  `goods_id` int(11) NOT NULL COMMENT '售后商品id ',
  `ogid` int(11) NOT NULL COMMENT 'order_goods关联id',
  `mobile` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户联系电话',
  `order_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单id',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '售后用户',
  `after_status` tinyint(4) NULL DEFAULT NULL COMMENT '状态0未申请1,申请中2不同意,,4维修中5换货中,6商家发货中，7用户确认收货,8同意',
  `after_sale_reson` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后原因',
  `after_sale_type` tinyint(1) NULL DEFAULT NULL COMMENT '售后类型1换货2，维修3，退款/退货',
  `after_sale_ask` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后要求',
  `after_sale_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `after_sale_pic` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '售后图片',
  `handle_yes_no_time` int(11) NULL DEFAULT NULL COMMENT '同意货拒绝时间',
  `handle_yes_no_user` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '处理人',
  `shop_wuliu_address` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商户地址',
  `shop_sure_get_goods` tinyint(1) NULL DEFAULT NULL COMMENT '1商家确认收货',
  `shop_sure_get_time` int(11) NULL DEFAULT NULL COMMENT '商家确认收货时间',
  `apply_time` int(11) NULL DEFAULT NULL COMMENT '申请时间',
  `refused_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '拒绝售后理由',
  `handle_time` int(11) NULL DEFAULT NULL COMMENT '处理时间',
  `user_wuliu_type_order` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户物流单号',
  `moren_address` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '默认寄回地址',
  `huan_wei_handle_time` int(11) NULL DEFAULT NULL COMMENT '确认收货时间换货维修',
  `send_time` int(11) NULL DEFAULT NULL COMMENT '商家发货时间',
  `send_wuliu_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送物流类型',
  `send_wuliu_order` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送物流单号',
  `yes_or_no` tinyint(1) NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

