-- ----------------------------
-- Table structure for fy_goods
-- ----------------------------
DROP TABLE IF EXISTS `fy_goods`;
CREATE TABLE `fy_goods`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '商品所属用户',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `pic` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品图片以json格式存储轮播图',
  `original_price` decimal(10, 2) UNSIGNED NOT NULL COMMENT '原价',
  `settlement_type` tinyint(4) NULL DEFAULT 1 COMMENT '结算类型1-货币2-积分3-积分+货币',
  `goods_class_id` int(10) NOT NULL COMMENT '商品分类id',
  `goods_brand_id` int(10) NULL DEFAULT NULL COMMENT '品牌id',
  `show_area` tinyint(4) NULL DEFAULT 3 COMMENT '展示区域1-限时抢购2-积分商城3-日常售卖4-热销产品5-积分+现价',
  `detail` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品详情',
  `status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1上架0仓库中',
  `main_image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品主图',
  `subtitle` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品副标题',
  `create_time` int(10) NULL DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) NULL DEFAULT NULL COMMENT '修改时间',
  `orderby` int(10) NULL DEFAULT NULL COMMENT '商品排序值',
  `click_count` int(10) NULL DEFAULT NULL COMMENT '商品点击数',
  `goods_weight` decimal(10, 3) NOT NULL COMMENT '商品重量',
  `start_date` int(11) NULL DEFAULT NULL COMMENT '开售时间',
  `end_date` int(11) NULL DEFAULT NULL COMMENT '结束时间',
  `is_real` tinyint(1) NOT NULL COMMENT '是否是实物1 是 0 否',
  `return_score` int(10) NULL DEFAULT NULL COMMENT '返现积分',
  `score_price` int(10) NULL DEFAULT NULL COMMENT '积分,价格',
  `price_real` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '价格',
  `score` int(10) NULL DEFAULT NULL COMMENT '积分换价',
  `basic_price` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '现价',
  `isdelete` tinyint(1) NULL DEFAULT 0 COMMENT '是否添加到回收站',
  `store_type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1下单减库存 2拍下减库存',
  `free_type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '包邮1不包邮0',
  `postage` decimal(10, 2) NULL DEFAULT NULL COMMENT '邮费',
  `after_sale` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后保障',
  `routine` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '常规参数以json存',
  `shop_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商家编码',
  `buy_num` int(11) NULL DEFAULT 0 COMMENT '销量',
  `bar_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品条形码',
  `is_return_goods` tinyint(1) NULL DEFAULT 1 COMMENT '1支持，0否',
  `yieldly` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '生产地',
  `is_comment` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否允许评论',
  `up_tip` tinyint(1) NULL DEFAULT 0 COMMENT '0未提醒1已提醒',
  `up_error_reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `service` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '字符串存储',
  `service_mobile` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商家联系电话',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 219 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

