  `goods_id` int(11) NOT NULL,
  `attribute_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品存贮所有属性的值',
  `goods_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品编码关联id',
  `store` int(11) NULL DEFAULT 0 COMMENT '库存',
  `price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '价格',
  `bar_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '条形码',
  `point_score` int(10) NULL DEFAULT 0 COMMENT '积分价',
  PRIMARY KEY (`id`) USING BTREE
