DROP TABLE IF EXISTS `fy_goods_comment`;
CREATE TABLE `fy_goods_comment`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '商品评价表',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `uid` int(11) NULL DEFAULT NULL,
  `goods_id` int(11) NULL DEFAULT NULL COMMENT '商品id',
  `goods_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `pic` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '评价晒图json存储最多5张',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '评论内容',
  `create_time` int(11) NULL DEFAULT NULL COMMENT '评论时间',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '状态，是否显示',
  `similarity_score` decimal(10, 2) NOT NULL COMMENT '相似积分',
  `logistics_score` decimal(10, 2) NOT NULL COMMENT '物流得分',
  `service_score` decimal(10, 2) NOT NULL COMMENT '服务积分',
  `avg_score` decimal(10, 2) NOT NULL COMMENT '平均分',
  `isdelete` tinyint(4) NOT NULL DEFAULT 0,
  `return_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '回复',
  `return_is` tinyint(1) NULL DEFAULT 0 COMMENT '0未回复1已回复',
  `user_id` int(11) NULL DEFAULT NULL COMMENT '所属商户id',
  `ogid` int(11) NULL DEFAULT NULL COMMENT '关联order_goods_id',
  PRIMARY KEY (`id`) USING BTREE
