-- ----------------------------
-- Table structure for fy_lottery
-- ----------------------------
DROP TABLE IF EXISTS `fy_lottery`;
CREATE TABLE `fy_lottery`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '奖券表',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '奖券名称',
  `pic` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权展示',
  `main_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '活动主题图',
  `grant_start_date` int(11) NULL DEFAULT NULL COMMENT '开始时间',
  `grant_end_date` int(11) NULL DEFAULT NULL COMMENT '结束时间',
  `expire_start_date` int(11) NULL DEFAULT NULL COMMENT '有效期开始时间',
  `expire_end_date` int(11) NULL DEFAULT NULL COMMENT '有效期截止时间',
  `type` tinyint(1) NOT NULL COMMENT '1抵扣券2优惠券3代金券4积分抵现金',
  `coupon_money` decimal(10, 2) NOT NULL COMMENT '优惠金额 减多少 ',
  `coupon_real_money` decimal(10, 2) NULL DEFAULT NULL COMMENT '优惠券面额 满多少',
  `receive_number` int(11) NULL DEFAULT 0 COMMENT '领取量',
  `surplus_number` int(11) NULL DEFAULT 0 COMMENT '剩余量',
  `number` int(11) NOT NULL DEFAULT 0 COMMENT '奖券数量',
  `goods_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '0表示所有商品关联商品',
  `goods_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品名称',
  `url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '链接',
  `desc` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '奖券说明',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '0未发行，1发行中，2领取完状态',
  `update_time` int(11) NULL DEFAULT NULL COMMENT '商户ID',
  `isdelete` tinyint(1) NULL DEFAULT 0 COMMENT '默认值为0表示没有删除',
  `user_id` int(11) NULL DEFAULT NULL COMMENT '商户ID',
  `expire_type` tinyint(1) NULL DEFAULT 0 COMMENT '默认设置有效期，1有效期领取之后',
  `expire_time` int(11) NULL DEFAULT NULL COMMENT '时间戳存储',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 22 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fy_lottery
-- ----------------------------

-- ----------------------------
-- Table structure for fy_lottery_log
-- ----------------------------
DROP TABLE IF EXISTS `fy_lottery_log`;
CREATE TABLE `fy_lottery_log`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '奖券参与明细表',
  `uid` int(11) NULL DEFAULT NULL COMMENT '用户id',
  `username` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '领取用户名',
  `addtime` int(11) NULL DEFAULT NULL COMMENT '领取时间',
  `lottery_id` int(11) NULL DEFAULT NULL COMMENT '奖券id',
  `status` tinyint(1) NULL DEFAULT 1 COMMENT '0禁用，1启用',
  `updatetime` int(11) NULL DEFAULT NULL COMMENT '使用时间',
  `lottery_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '奖券名称',
  `use_num` int(1) NULL DEFAULT 0 COMMENT '使用张数 默认0',
