-- ----------------------------
-- Table structure for fy_order
-- ----------------------------
DROP TABLE IF EXISTS `fy_order`;
CREATE TABLE `fy_order`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单表',
  `order_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `order_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '0未支付1已支付2待评价，3待回复，4,待退款 5部分退款，6全部退款，7取消订单，8订单完成',
  `buy_list` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品列表',
  `total_price` decimal(10, 2) NOT NULL COMMENT '订单总价',
  `create_time` int(10) NOT NULL COMMENT '时间',
  `remarks` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `uid` int(11) NULL DEFAULT NULL COMMENT '用户id',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户id',
  `customer_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `address_id` int(10) NULL DEFAULT NULL COMMENT '地址id',
  `pay_time` int(10) NULL DEFAULT NULL COMMENT '付款时间',
  `js_api_parameters` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '微信支付所需参数',
  `prepay_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '统一下单接口返回的预付id',
  `pay_status` tinyint(1) NULL DEFAULT 0 COMMENT '支付状态;0未付款;1已付款 ',
  `inv_payee` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发票抬头,用户页面填写 ',
  `inv_content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发票内容,用户页面选择,取值shop_config的code字段的值 为invoice_content的value ',
  `goods_all` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `user_id` int(11) NOT NULL COMMENT '商户id',
  `isdelete` tinyint(1) NOT NULL DEFAULT 0,
  `lottery_id` int(11) NULL DEFAULT NULL COMMENT '优惠券id',
  `lottery_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '优惠券金额',
  `is_lottery` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0没有1有',
  `return_price_all` decimal(10, 2) NULL DEFAULT NULL COMMENT '退款金额',
  `total_point` decimal(10, 2) NULL DEFAULT NULL COMMENT '积分总价',
  `type` tinyint(1) NULL DEFAULT 0 COMMENT '0表示纯金钱的订单1纯积分，2两种混合',
  `is_settlement` tinyint(1) NULL DEFAULT 0 COMMENT '0未结算 1结算',
  `is_tui` tinyint(1) NULL DEFAULT 0 COMMENT '0为推送支付成功，1已经推送',
  `address_detail` varchar(3000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 453 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fy_order
-- ----------------------------

-- ----------------------------
-- Table structure for fy_order_all
-- ----------------------------
DROP TABLE IF EXISTS `fy_order_all`;
CREATE TABLE `fy_order_all`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '总的订单id',
  `son_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '子id',
  `status` tinyint(1) NULL DEFAULT NULL COMMENT '1支付0，未支付',
  `total_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '订单总价',
  `create_time` int(11) NULL DEFAULT NULL,
  `is_tui` tinyint(1) NULL DEFAULT 0 COMMENT '1已经推送0为推送',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 388 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fy_order_all
-- ----------------------------

-- ----------------------------
-- Table structure for fy_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `fy_order_goods`;
CREATE TABLE `fy_order_goods`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单商品表',
  `goods_id` int(11) NOT NULL,
  `sku_id` int(11) NULL DEFAULT NULL COMMENT 'skuid',
  `order_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '父id 订单id',
  `user_id` int(11) NULL DEFAULT NULL COMMENT '所属商户',
  `goods_detail` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品详情json存储',
  `is_free` tinyint(1) NULL DEFAULT 0 COMMENT '1包邮0不包邮，3上门自取',
  `shipping_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '配送费用',
  `logistics_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流名称',
  `logistics_number` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `send_time` int(11) NULL DEFAULT NULL COMMENT '发货时间',
  `refuse_reson` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款理由',
  `is_send` tinyint(1) NULL DEFAULT 0 COMMENT '0未发货1已发货，2待评价。3退款中，4退款完成,,5待回复，6完成,7退货退款',
  `remind_get` tinyint(1) NULL DEFAULT 0 COMMENT '0否1是 提醒过用户收货',
  `words` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单备注',
  `goods_num` int(10) NOT NULL DEFAULT 1 COMMENT '购买商品数量',
  `sku_val` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'sku值',
  `address_id` int(11) NOT NULL COMMENT '地址id',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `is_return` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0否1待退款2已退款3退款失败',
  `return_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '退款',
  `get_goods_time` int(11) NULL DEFAULT NULL COMMENT '确认收货时间',
  `address_detail` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '收货地址',
  `after_sale_is` tinyint(1) NULL DEFAULT 0 COMMENT '0未提交1提交2售后完成',
  `after_handle_is` tinyint(1) NULL DEFAULT 0 COMMENT '0未处理，1已经处理',
  `is_lottery` tinyint(1) NULL DEFAULT 0 COMMENT '0fou 1是',
  `lottery_id` int(10) NULL DEFAULT NULL COMMENT '奖券id',
  `lottery_log_id` int(10) NULL DEFAULT NULL COMMENT '奖券领取id',
  `lottery_detail` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '奖券详情',
  `real_pay_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际支付价格',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 478 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of fy_order_goods
-- ----------------------------

