INSERT INTO `fy_customer_grade_desc` VALUES (5, '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.会员共分为4个等级，分别为：青铜会员、白银会员、黄金会员、钻石会员。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.会员级别由经验值决定，经验值越高会员等级越高，享受到的会员权益越多。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.成长值与消费金额成正比，完成购物后获得与结算金额相对应的成长值。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.会员级别的升降均由系统自动处理，无需申请。&lt;/span&gt;&lt;/p&gt;&lt;table align=&quot;center&quot;&gt;&lt;tbody&gt;&lt;tr class=&quot;firstRow&quot;&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;会员级别&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;经验值范围&lt;/span&gt;&lt;/td&gt;&lt;td rowspan=&quot;1&quot; valign=&quot;middle&quot; align=&quot;center&quot; style=&quot;border-color: rgb(221, 221, 221); word-break: break-all;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;会员有效期&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;青铜会员&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;注册成功即可&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;永久有效&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;白银会员&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;经验值达到2000&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;永久有效&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;黄金会员&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;经验值达到10000&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;永久有效&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;钻石会员&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;经验值达到30000&lt;/span&gt;&lt;/td&gt;&lt;td valign=&quot;middle&quot; style=&quot;word-break: break-all; border-color: rgb(221, 221, 221);&quot; align=&quot;center&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;永久有效&lt;/span&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', 1530842063, 1, 1532600995, 0, 1);
